import React, { Component } from "react";
class Decrement extends Component{
    deleteTask(taskkey) {
        this.props.deleteTask(taskkey);
    }
    render() {
        return (<button onClick={() => this.deleteTask(this.props.key)}>x</button>);
    }
}

export default Decrement;
